  true,\n\t\"url\": null,\n\t\"notes\": \"<div>This dataset covers the geographic
  are within the Town of Morrisville municipal boundary.u00a0Theu00a0<b>Morrisville
  Town Council</b>u00a0dataset includes polygons which represent the boundaries for
  each Town Council district. This dataset also includes labels and other data relating
  to each district and its representative.u00a0The Morrisville Town council is made
  up of two at-large representatives, and four district representatives. Each resident
  of Morrisville has one district representative, determined by the electoral district
  in which their residence falls.u00a0</div><div><br /></div><div>Part of a map service
  displaying administrative boundaries for Wake County and the City of Raleigh.</div><div><br
